nacional.tokenizeString = function(string) {
        var stopWords = ["mcpio", "mps", "los", "calle", "municipio", "estado", "con", "avenida", "principal", "las", "frente", "edo", "entre", "urb", "sto", "sra"];
        return string.split(/[\s\.,;\:\\/\[\]\(\)\{\}]+/).map(function(val) {
            return val.toLowerCase();
        }).filter(function(val) {
            for (w in stopWords) {
                if (stopWords[w] == val) return false;
            }
            return true;
        }).map(function(word) {
            return {t: word, w: 1};
        });
};
